// Initialize the cart and total price
let cart = [];
let totalPrice = 0.00;

// Define restaurant data with image URLs for each dish
const restaurantKavi = {
    name: "Kavi Restaurant",
    location: "123 Food Street, Trichy",
    menu: [
        { name: "Pizza", price: 120, image: "data:image/jpeg;base64," },
        { name: "Burger", price: 90, image: "data:image/jpeg;base64," },
        { name: "Pasta", price: 100, image: "data:image/jpeg;base64," },
        { name: "Salad", price: 70, image: "data:image/jpeg;base64," },
        { name: "Sushi", price: 110, image: "data:image/jpeg;base64," },
        { name: "Noodles", price: 90, image: "data:image/jpeg;base64," }
    ]
};

const restaurantSpicyDelights = {
    name: "Spicy Delights",
    location: "456 Spice Lane, Chennai",
    menu: [
        { name: "Spicy Chicken Wings", price: 150, image: "data:image/jpeg;base64," },
        { name: "Paneer Tikka", price: 120, image: "data:image/jpeg;base64," },
        { name: "Biryani", price: 200, image: "data:image/jpeg;base64," },
        { name: "Masala Dosa", price: 50, image: "data:image/jpeg;base64," },
        { name: "Samosa", price: 50, image: "data:image/jpeg;base64," },
        { name: "Mango Lassi", price: 80, image: "data:image/jpeg;base64," }
    ]
};

// Load the menu for the selected restaurant
function loadMenu(restaurantName, restaurantLocation, menuItems) {
    // Update restaurant details on the page
    document.getElementById('restaurant-location').textContent = `Restaurant Location: ${restaurantLocation}`;
    
    // Clear previous menu items
    const menuList = document.getElementById('menuItems');
    menuList.innerHTML = '';

    // Add each dish from the selected restaurant's menu with images
    menuItems.forEach(item => {
        const li = document.createElement('li');
        const img = document.createElement('img');
        img.src = item.image;  // Set image source
        img.alt = item.name;    // Set alt text
        img.style.width = "100px"; // Resize image if necessary
        img.style.marginRight = "10px";  // Space between image and text

        const button = document.createElement('button');
        button.textContent = `${item.name} - $${item.price.toFixed(2)}`;
        button.onclick = () => addToCart(item.name, item.price);

        li.appendChild(img);  // Append image to the list item
        li.appendChild(button);  // Append button to the list item
        menuList.appendChild(li);
    });
}

// Add item to cart
function addToCart(name, price) {
    const item = { name, price };
    cart.push(item);
    totalPrice += price;
    updateCart();
    saveCart();
}

// Update cart display
function updateCart() {
    const cartItems = document.getElementById('cartItems');
    cartItems.innerHTML = ''; // Clear current cart items

    // Add items to cart list
    cart.forEach((item, index) => {
        const li = document.createElement('li');
        li.textContent = `${item.name} - $${item.price.toFixed(2)}`;

        // Create a remove button for each item
        const removeButton = document.createElement('button');
        removeButton.textContent = 'Remove';
        removeButton.onclick = () => removeFromCart(index);

        li.appendChild(removeButton);
        cartItems.appendChild(li);
    });

    // Update total price
    const totalPriceElement = document.getElementById('totalPrice');
    totalPriceElement.textContent = `Total Price: $${totalPrice.toFixed(2)}`;
}

// Remove item from cart
function removeFromCart(index) {
    const item = cart[index];
    cart.splice(index, 1);
    totalPrice -= item.price;
    updateCart();
    saveCart();
}

// Clear cart
function clearCart() {
    cart = [];
    totalPrice = 0;
    updateCart();
    saveCart();
}

// Save cart data to localStorage
function saveCart() {
    localStorage.setItem('cart', JSON.stringify(cart));
    localStorage.setItem('totalPrice', totalPrice.toFixed(2));
}

// Load cart from localStorage
function loadCart() {
    const storedCart = JSON.parse(localStorage.getItem('cart')) || [];
    const storedTotalPrice = parseFloat(localStorage.getItem('totalPrice')) || 0.00;
    
    cart = storedCart;
    totalPrice = storedTotalPrice;
    updateCart();
}

// Checkout button (just for display in this example)
function checkout() {
    alert(`Your total price is $${totalPrice.toFixed(2)}. Thank you for your order!`);
    clearCart(); // Clear cart after checkout
}

// Event listeners for cart actions
document.getElementById('clearCartBtn').addEventListener('click', clearCart);
document.getElementById('checkoutBtn').addEventListener('click', checkout);

// Initialize page and load the first restaurant's menu by default
document.addEventListener('DOMContentLoaded', function() {
    loadMenu('Kavi Restaurant', '123 Food Street, Trichy', restaurantKavi.menu);
});
